Также есть логические связки: and — и, or — или, not — отрицание. Пример: если возраст больше 18 и есть паспорт — можно путешествовать. Если он студент или учитель — доступ к платформе разрешён. not инвертирует логическое значение. Например: если пользователь не забанен — добро пожаловать. Если забанен — не пускаем.
