int(input(...)) — это способ сразу получить число, а не текст. int переводит ввод в целое число. Теперь проверим условия:
        code:
        if age >= 18:
            print("Полный доступ разрешён")
        elif age >= 15:
            print("Частичный доступ разрешён")
        else:
            print("Доступ запрещён")

Разберём подробнее: Если возраст больше или равен 18 — полный доступ. Если не попал в это условие, но возраст больше или равен 15 — частичный доступ. Иначе — доступ запрещён.
        code:
        if age >= 18:
            print("Полный доступ разрешён")
        elif age >= 15:
            print("Частичный доступ разрешён")
        else:
            print("Доступ запрещён")

Примеры: Вводим 25 — полный доступ. Вводим 4 — доступ запрещён. Вводим 15 — частичный доступ
