А если range(0, 10, 2), будет: 0, 2, 4, 6, 8 — шаг 2, только чётные числа. Если range(0, 20, 1), это будет считалочка. Если range(0, 20, 13) — будет: 0, 13. Следующее выходит за пределы.
        code:
        for i in range(0, 10, 2):
            print(i)
        code:
        for i in range(0, 20, 1):
            print(i)
        code:
        for i in range(0, 20, 13):
            print(i)

Как я и говорил, дубликаты в сете невозможны. Если написать 1, 2, 2, 3, то в выводе двойка будет только одна. Если добавить ещё тройку вместо однерки, то при выводе сет покажет, 2, 3 — без повторов.
        code:
        a = {1, 2, 2, 3}
        print(a)
        a = {3, 2, 2, 3}
        print(a)

В листе можно добавлять одинаковые элементы. Например, два "green" — и они оба будут в списке. Если вывести — увидим два "green". А в set'е, даже если написать два "green" и два "red", то при выводе будет только по одному: red и green. Добавим, например, "yellow", и снова выведем.
        colors = {"red", "green", "green", "red"}
        print(colors)
        colors = {"red", "green", "yellow", "red}
        print(colors)

Теперь разберем другой пример. У нас есть список `numbers` с числами. Создаем цикл `for`, пишем: `for n in numbers`. Далее — если `n != 0`, то выводим `n`. Таким образом, цикл `for` используется для фильтрации значений внутри списка. Мы выводим все значения, кроме нуля.
  code:
  numbers = [1, 2, 0, 4, 0, 5]
    for n in numbers:
      if n != 0:
        print(n),

Если `n == 0`, то его не выводим. Например: `1 2 4 5` — ноль пропускается. Также мы можем фильтровать четные числа. Пишем условие: `if n % 2 == 0`, то есть если число делится на 2 без остатка, значит оно четное. Пример: `4 / 2 = 2`, остаток — 0. Такое число будет выведено.
  code:
  numbers = [1, 2, 0, 4, 0, 5]
    for n in numbers:
      if n % 2 == 0:
        print(n),

Ошибка называется `ZeroDivisionError` — деление на ноль. То есть, как и в математике, делить на ноль нельзя. Также могла бы быть ошибка, если бы мы ввели не число, а, скажем, слово — например, "хлеб". Тогда возникла бы ошибка `ValueError`. Покажу, как это обработать. Теперь код выглядит так: `try` — попробуй выполнить этот блок, а `except` — если возникает ошибка, обработай её.
  code:
  try:
    x = int(input("Введите число: "))
    print(100 / x)
  except ZeroDivisionError:
    print("На ноль делить нельзя")
  except ValueError:
    print("Нужно ввести число")

Если появляется ошибка деления на ноль, мы выводим: "На ноль делить нельзя". То есть вместо технической ошибки `ZeroDivisionError`, Python покажет более понятное сообщение. Если вводим текст вместо числа — покажем сообщение: "Нужно ввести число".
  code:
  try:
    x = int(input("Введите число: "))
    print(100 / x)
  except ZeroDivisionError:
    print("На ноль делить нельзя")
  except ValueError:
    print("Нужно ввести число")
